    calculateTotals() {
        let subtotal = 0;
        let totalTax = 0;

        this.currentInvoice.items.forEach(item => {
            const lineTotal = item.quantity * item.unit_price;
            const lineTax = lineTotal * (item.tax_rate / 100);
            subtotal += lineTotal;
            totalTax += lineTax;
        });

        const total = subtotal + totalTax;
        let deposit = 0;
        let balance = total;

        if (this.currentInvoice.invoice_type === 'deposit') {
            if (this.currentInvoice.deposit_amount > 0) {
                deposit = this.currentInvoice.deposit_amount;
            } else if (this.currentInvoice.deposit_percent > 0) {
                deposit = total * (this.currentInvoice.deposit_percent / 100);
            }
            balance = deposit;
        } else if (this.currentInvoice.invoice_type === 'final') {
            // For final invoices, we'd need to reference a deposit
            // For now, we'll show the full amount
            balance = total;
        }

        // Update display
        document.getElementById('subtotal').textContent = subtotal.toFixed(2);
        document.getElementById('total-tax').textContent = totalTax.toFixed(2);
        document.getElementById('total').textContent = total.toFixed(2);
        document.getElementById('deposit-amount-display').textContent = deposit.toFixed(2);
        document.getElementById('balance-amount').textContent = balance.toFixed(2);

        // Update line item totals
        this.renderLineItems();
    }

