    async downloadDocx() {
        try {
            const button = document.getElementById('download-docx');
            button.disabled = true;
            button.innerHTML = '<span class="spinner"></span> Generating...';

            let docxBlob;
            
            if (this.currentInvoice.template_mode === 'docx-template') {
                docxBlob = await this.generateWithTemplate();
            } else {
                docxBlob = await this.generateProgrammatically();
            }

            const filename = `${this.currentInvoice.invoice_number}-${this.currentInvoice.recipient.name}-${this.currentInvoice.issue_date}.docx`;
            saveAs(docxBlob, filename);

            button.disabled = false;
            button.textContent = 'Download Word Document';
        } catch (error) {
            console.error('Error generating document:', error);
            console.error('Error details:', error.message);
            console.error('Error stack:', error.stack);
            alert(`Error generating document: ${error.message}. Please check the console for details.`);
            
            const button = document.getElementById('download-docx');
            button.disabled = false;
            button.textContent = 'Download Word Document';
        }
    }

