    saveDraft() {
        const draft = {
            ...this.currentInvoice,
            id: Date.now().toString(),
            savedAt: new Date().toISOString(),
            title: `${this.currentInvoice.invoice_number || 'Draft'} - ${this.currentInvoice.recipient.name || 'Untitled'}`
        };

        this.drafts.push(draft);
        this.saveDrafts();
        this.renderDrafts();
        
        // Show success message
        const button = document.getElementById('save-draft');
        const originalText = button.textContent;
        button.textContent = 'Saved!';
        button.style.background = '#28a745';
        setTimeout(() => {
            button.textContent = originalText;
            button.style.background = '';
        }, 2000);
    }

    loadDraft(draftId) {
        const draft = this.drafts.find(d => d.id === draftId);
        if (draft) {
            this.currentInvoice = { ...draft };
            this.navigateTo('editor');
        }
    }

    deleteDraft(draftId) {
        this.drafts = this.drafts.filter(d => d.id !== draftId);
        this.saveDrafts();
        this.renderDrafts();
    }

    loadDrafts() {
        const saved = localStorage.getItem('invoice-drafts');
        return saved ? JSON.parse(saved) : [];
    }

    saveDrafts() {
        localStorage.setItem('invoice-drafts', JSON.stringify(this.drafts));
    }

    renderDrafts() {
        const container = document.getElementById('drafts-list');
        container.innerHTML = '';

        if (this.drafts.length === 0) {
            container.innerHTML = '<p>No drafts saved yet.</p>';
            return;
        }

        this.drafts.forEach(draft => {
            const draftElement = document.createElement('div');
            draftElement.className = 'draft-item';
            draftElement.innerHTML = `
                <h4>${draft.title}</h4>
                <p>Type: ${draft.invoice_type} | Saved: ${new Date(draft.savedAt).toLocaleDateString()}</p>
                <div class="draft-actions">
                    <button class="btn btn-primary" onclick="app.loadDraft('${draft.id}')">Edit</button>
                    <button class="btn btn-danger" onclick="app.deleteDraft('${draft.id}')">Delete</button>
                </div>
            `;
            container.appendChild(draftElement);
        });
    }

    setCurrentDate() {
        // Use the predefined date from the invoice
        document.getElementById('issue-date').value = '2025-07-15';
    }

    previewInvoice() {
        // Validate required fields
        if (!this.currentInvoice.issuer.name || !this.currentInvoice.recipient.name || 
            !this.currentInvoice.invoice_number || !this.currentInvoice.issue_date) {
            alert('Please fill in all required fields (marked with *)');
            return;
        }

        if (this.currentInvoice.items.length === 0 || 
            this.currentInvoice.items.every(item => !item.description)) {
            alert('Please add at least one line item');
            return;
        }

        this.navigateTo('preview');
    }
